import React from 'react';
import { Link } from 'react-router-dom';
import '../css/footer.css';

const ElementoFooter = () => {
  return (
    <footer className="footer">
      <ul className="footer-list">
        <li className="footer-item"><Link to="/" className="footer-link">Inicio</Link></li>
        <li className="footer-item"><Link to="/acerca" className="footer-link">Acerca</Link></li>
        <li className="footer-item"><Link to="/contacto" className="footer-link">Contacto</Link></li>
        <li className="footer-item"><Link to="/Confeciones-creacion" className="footer-link">Hacemos Tu Confecciones</Link></li>
        <li className="footer-item"><Link to="/login" className="footer-link">Login</Link></li>
      </ul>
    </footer>
  );
};

export default ElementoFooter;
